$(document).ready(function(){$(".carousel").carousel({interval:5000});var a=$("#fillingPlaceTab");a.find("a").click(function(f){f.preventDefault();$(this).tab("show")});var e;var b=new google.maps.LatLng(21.005321,105.84715);var d=new google.maps.LatLng(21.006347,105.846906);var c=new google.maps.LatLng(21.004975,105.847043);e=new google.maps.Map(document.getElementById("map-canvas"),{zoom:18,center:b,mapTypeId:google.maps.MapTypeId.ROADMAP});new google.maps.Marker({position:b,map:e,draggable:false,animation:google.maps.Animation.DROP});new google.maps.Marker({position:d,map:e,draggable:false,animation:google.maps.Animation.DROP});new google.maps.Marker({position:c,map:e,draggable:false,animation:google.maps.Animation.DROP});a.find("a").on("shown",function(h){var g=$(h.target).attr("href");var f;switch(g){case"#collaborator-viet-dung":f=b;break;case"#collaborator-manh-duy":f=d;break;case"#collaborator-cam-khang":f=c;break;default:break}e.panTo(f)})});